import React from "react";

const PersonCard = (props) => {
    return (
        <div className="card">
            <h3>{props.name}</h3>
            <img src={props.img} alt="avatar"/>
            <p>{props.tel}</p>
            <p>{props.email}</p>
            <button className="button">More info</button>
        </div>
    )
}

export default PersonCard;
